definition:
message Schema {
  // The person's name.
  string name = 1;

  // The person's LinkedIn profile URL.
  string linkedin_profile_url = 2;

  // The person's job title.
  string job_title = 3;

  // The person's company.
  string company = 4;

  // The person's location.
  string location = 5;

  // The person's connections count.
  int32 connections_count = 6;

  // The person's about section.
  string about = 7;

  // The person's experience.
  repeated Experience experience = 8;

  // The person's education.
  repeated Education education = 9;

  // The person's skills.
  repeated string skills = 10;
}

message Experience {
  // The company name.
  string company = 1;

  // The job title.
  string job_title = 2;

  // The start date.
  string start_date = 3;

  // The end date.
  string end_date = 4;

  // The description.
  string description = 5;
}

message Education {
  // The school name.
  string school = 1;

  // The degree.
  string degree = 2;

  // The field of study.
  string field_of_study = 3;

  // The start date.
  string start_date = 4;

  // The end date.
  string end_date = 5;
}
